import React from "react";
import { useNavigate } from "react-router-dom";

export default function Menu() {
  const nav = useNavigate();

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Biblioteca Virtual</h1>
      <div style={styles.menu}>
        <button style={styles.btn} onClick={() => nav("/libros")}>
          Libros
        </button>
        <button style={styles.btn} onClick={() => nav("/grafico")}>
          Gráfico
        </button>
        <button style={styles.btn} onClick={() => nav("/reporte")}>
          Reporte PDF
        </button>
        <button style={styles.btn} onClick={() => nav("/usuarios")}>
          Usuarios
        </button>
      </div>
    </div>
  );
}

const styles = {
  container: {
    background: "#f2f2f2",
    height: "100vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
  },
  title: {
    fontSize: "40px",
    marginBottom: "30px",
  },
  menu: {
    display: "flex",
    flexDirection: "column",
    gap: "15px",
  },
  btn: {
    width: "250px",
    padding: "15px",
    borderRadius: "10px",
    border: "none",
    background: "#4A90E2",
    color: "white",
    fontSize: "20px",
    cursor: "pointer",
  },
};
